import React from 'react';
import './styles.css';
import {Link } from 'react-router-dom';


const Header = () =>(
    <header id="main-header">
              <ul>
              <li>
                  <a href='/'>Home</a>
                </li>
                <li className="nav-item">
                  <a href='/create'>Create</a>
                </li>
                <li className="nav-item">
                  <a href='/index'>Index</a>
                </li>
              </ul>
      </header>
);

export default Header;
